// prediction params
var sample_softmax_temperature = 0.72; // how peaky model predictions should be
var max_chars_gen = 8; // max length of generated sentences

// various global var inits
var epoch_size = -1;
var input_size = -1;
var output_size = -1;
var letterToIndex = {};
var indexToLetter = {};
var vocab = [];
var data_sents = [];
var solver = new R.Solver(); // should be class because it needs memory for step caches

var model = {};

var hidden_sizes;
var generator;
//var letter_size;


BasicGame.loadModel = function(j) {
  hidden_sizes = j.hidden_sizes;
  generator = j.generator;
  //letter_size = j.letter_size;
  model = {};
  for(var k in j.model) {
    if(j.model.hasOwnProperty(k)) {
      var matjson = j.model[k];
      model[k] = new R.Mat(1,1);
      model[k].fromJSON(matjson);
    }
  }
  solver = new R.Solver(); // have to reinit the solver since model changed
  solver.decay_rate = j.solver.decay_rate;
  solver.smooth_eps = j.solver.smooth_eps;
  solver.step_cache = {};
  for(var k in j.solver.step_cache){
      if(j.solver.step_cache.hasOwnProperty(k)){
          var matjson = j.solver.step_cache[k];
          solver.step_cache[k] = new R.Mat(1,1);
          solver.step_cache[k].fromJSON(matjson);
      }
  }
  letterToIndex = j['letterToIndex'];
  indexToLetter = j['indexToLetter'];
  vocab = j['vocab'];
}

BasicGame.forwardIndex = function(G, model, ix, prev) {
  var x = G.rowPluck(model['Wil'], ix);
  // forward prop the sequence learner
  if(generator === 'rnn') {
    var out_struct = R.forwardRNN(G, model, hidden_sizes, x, prev);
  } else {
    var out_struct = R.forwardLSTM(G, model, hidden_sizes, x, prev);
  }
  return out_struct;
}

BasicGame.predictSentence = function(model, samplei, temperature) {
  if(typeof samplei === 'undefined') { samplei = false; }
  if(typeof temperature === 'undefined') { temperature = 1.0; }

  var G = new R.Graph(false);
  var s = '';
  var prev = {};
  while(true) {

    // RNN tick
    var ix = s.length === 0 ? 0 : letterToIndex[s[s.length-1]];
    var lh = BasicGame.forwardIndex(G, model, ix, prev);
    prev = lh;

    // sample predicted letter
    logprobs = lh.o;
    if(temperature !== 1.0 && samplei) {
      // scale log probabilities by temperature and renormalize
      // if temperature is high, logprobs will go towards zero
      // and the softmax outputs will be more diffuse. if temperature is
      // very low, the softmax outputs will be more peaky
      for(var q=0,nq=logprobs.w.length;q<nq;q++) {
        logprobs.w[q] /= temperature;
      }
    }

    probs = R.softmax(logprobs);
    if(samplei) {
      var ix = R.samplei(probs.w);
    } else {
      var ix = R.maxi(probs.w);  
    }
    
    if(ix === 0) break; // END token predicted, break out
    if(s.length > max_chars_gen) { break; } // something is wrong

    var letter = indexToLetter[ix];
    s += letter;
  }
  return s;
}

BasicGame.AI_createMap = function(size){
    // draw samples
    var mapData = [];
    for(var q=0;q<size;q++) {
      var pred = BasicGame.predictSentence(model, true, sample_softmax_temperature);
      var pred_ls = pred.split("");
      var emptyBlockCount = 0; // empty block has to be at least half amount!
      for (var i = 0; i < pred_ls.length; i++){

        var mapId = parseInt(pred_ls[i]);
        if (mapId === 4) // prevent map endpoint for infinite AI challenge!
          mapId = 0;
        
        pred_ls[i] = mapId;

        if (mapId > 0)
          emptyBlockCount += 1; // count all empty blocks
      }

      // clear some path
      if (emptyBlockCount <= 4)
      {
        for (var i = 3; i < 6; i++){
          pred_ls[i] = 0;
        }
      }

      mapData.push(pred_ls);
    }
    return mapData;
};

